import React from 'react';
import { Menu, Segment,Header,Grid } from 'semantic-ui-react';

export default function Head() {
  const navData = ['Home', 'Pokemon', 'About Me'];
  const menu = navData.map((item, i) => {
    return (
      <Menu.Item key={i} name={item} as='a' >
        {item}
      </Menu.Item>
    );
  });
  return (
    <Segment inverted>
      <Menu secondary inverted pointing styles={{margin:0}} >
        {menu}

      </Menu>

      <Grid>
        <Grid.Row>
        <Header as='h1' color='red' floated='right' width={8} > Pokemon</Header>
        </Grid.Row>
      </Grid>

    </Segment>
  );
}
